import React from "react";
import Header from "./components/Header";
import './css/main.css'
import { GoogleFontLoader } from 'react-google-font-loader';

class App extends React.Component { 
    render(){
        return(<div>
            <GoogleFontLoader fonts={[{ font: 'Murecho' }]}/>
        <Header/>
        </div>)
        
    }
}

export default App
